<?php

$inputs = '



';

$inputLine = explode(PHP_EOL, $inputs);
$possibleMoves = [
	'1' => '3:1',
	'2' => '2:2',
	'3' => '3:2',
	'4' => '4:2',
	'5' => '1:3',
	'6' => '2:3',
	'7' => '3:3',
	'8' => '4:3',
	'9' => '5:3',
	'A' => '2:4',
	'B' => '3:4',
	'C' => '4:4',
	'D' => '3:5'
];
$tempX = $tempY = $x = $y = 2;
foreach ($inputLine as $v) {
	$instructions = str_split($v);
	foreach ($instructions as $ins) {
		$tempX = ($ins == 'L') ? --$tempX : ($ins == 'R' ? ++$tempX : $tempX);
		$x = in_array($tempX . ':' . $tempY, $possibleMoves) ? $tempX : $x;
		$tempY = ($ins == 'U') ? --$tempY : ($ins == 'D' ? ++$tempY : $tempY);
		$y = in_array($tempX . ':' . $tempY, $possibleMoves) ? $tempY : $y;
		$tempX = $x; $tempY = $y;
	}
	echo $x . $y . PHP_EOL;
}